import{_ as p,o as a,c as t,U as e}from"./chunks/framework.1bc6aac7.js";const m=JSON.parse('{"title":"http常用的状态码","description":"","frontmatter":{},"headers":[],"relativePath":"面试经验/55-http状态.md"}'),r={name:"面试经验/55-http状态.md"},o=e('<h1 id="http常用的状态码" tabindex="-1">http常用的状态码 <a class="header-anchor" href="#http常用的状态码" aria-label="Permalink to &quot;http常用的状态码&quot;">​</a></h1><h2 id="_1开头-临时响应-用于表示临时响应并需要请求者执行操作才能继续的状态代码。" tabindex="-1">1开头（临时响应）用于表示临时响应并需要请求者执行操作才能继续的状态代码。 <a class="header-anchor" href="#_1开头-临时响应-用于表示临时响应并需要请求者执行操作才能继续的状态代码。" aria-label="Permalink to &quot;1开头（临时响应）用于表示临时响应并需要请求者执行操作才能继续的状态代码。&quot;">​</a></h2><p>100（继续）请求者应当继续提出请求。服务器返回此代码则意味着，服务器已收到了请求的第一部分，现正在等待接收其余部分。</p><p>101（切换协议）请求者已要求服务器切换协议，服务器已确认并准备进行切换。</p><h2 id="_2开头-请求成功-表示成功处理了请求的状态代码" tabindex="-1">2开头 （请求成功）表示成功处理了请求的状态代码 <a class="header-anchor" href="#_2开头-请求成功-表示成功处理了请求的状态代码" aria-label="Permalink to &quot;2开头 （请求成功）表示成功处理了请求的状态代码&quot;">​</a></h2><p>200 （成功） 服务器已成功处理了请求。 通常，这表示服务器提供了请求的网页。 201 （已创建） 请求成功并且服务器创建了新的资源。 202 （已接受） 服务器已接受请求，但尚未处理。 203 （非授权信息） 服务器已成功处理了请求，但返回的信息可能来自另一来源。 204 （无内容） 服务器成功处理了请求，但没有返回任何内容。 205 （重置内容） 服务器成功处理了请求，但没有返回任何内容。 206 （部分内容） 服务器成功处理了部分 GET 请求。</p><h2 id="_3开头-请求被重定向-表示要完成请求-需要进一步操作。-通常-这些状态代码用来重定向" tabindex="-1">3开头 （请求被重定向）表示要完成请求，需要进一步操作。 通常，这些状态代码用来重定向 <a class="header-anchor" href="#_3开头-请求被重定向-表示要完成请求-需要进一步操作。-通常-这些状态代码用来重定向" aria-label="Permalink to &quot;3开头 （请求被重定向）表示要完成请求，需要进一步操作。 通常，这些状态代码用来重定向&quot;">​</a></h2><p>300 （多种选择） 针对请求，服务器可执行多种操作。 服务器可根据请求者 (user agent) 选择一项操作，或提供操作列表供请求者选择。</p><p>301 （永久移动） 请求的网页已永久移动到新位置。 服务器返回此响应（对 GET 或 HEAD 请求的响应）时，会自动将请求者转到新位置。</p><p>302 （临时移动） 服务器目前从不同位置的网页响应请求，但请求者应继续使用原有位置来进行以后的请求。</p><p>303 （查看其他位置） 请求者应当对不同的位置使用单独的 GET 请求来检索响应时，服务器返回此代码。</p><p>304 （未修改） 自从上次请求后，请求的网页未修改过。 服务器返回此响应时，不会返回网页内容。</p><p>305 （使用代理） 请求者只能使用代理访问请求的网页。 如果服务器返回此响应，还表示请求者应使用代理。</p><p>307 （临时重定向） 服务器目前从不同位置的网页响应请求，但请求者应继续使用原有位置来进行以后的请 求。</p><h2 id="_4开头-请求错误-这些状态代码表示请求可能出错-妨碍了服务器的处理" tabindex="-1">4开头 （请求错误）这些状态代码表示请求可能出错，妨碍了服务器的处理 <a class="header-anchor" href="#_4开头-请求错误-这些状态代码表示请求可能出错-妨碍了服务器的处理" aria-label="Permalink to &quot;4开头 （请求错误）这些状态代码表示请求可能出错，妨碍了服务器的处理&quot;">​</a></h2><p>400 （错误请求） 服务器不理解请求的语法。</p><p>401 （未授权） 请求要求身份验证。 对于需要登录的网页，服务器可能返回此响应。</p><p>403 （禁止） 服务器拒绝请求。</p><p>404 （未找到） 服务器找不到请求的网页。</p><p>405 （方法禁用） 禁用请求中指定的方法。</p><p>406 （不接受） 无法使用请求的内容特性响应请求的网页。</p><p>407 （需要代理授权） 此状态代码与 401（未授权）类似，但却指定了请求者应当使用代理进行授权。如果服务器返回此响应，那么，服务器还会指明请求者应当使用的代理。</p><p>408 （请求超时） 服务器等候请求时发生超时。</p><p>409 （冲突） 服务器在完成请求时发生冲突。 服务器必须在响应中包含有关冲突的信息。</p><p>410 （已删除） 如果请求的资源已永久删除，服务器就会返回此响应。</p><p>411 （需要有效长度） 服务器不接受不含有效内容长度标头字段的请求。</p><p>412 （未满足前提条件） 服务器未满足请求者在请求中设置的其中一个前提条件。</p><p>413 （请求实体过大） 服务器无法处理请求，因为请求实体过大，超出服务器的处理能力。</p><p>414 （请求的 URI 过长） 请求的 URI（通常为网址）过长，服务器无法处理。</p><p>415 （不支持的媒体类型） 请求的格式不受请求页面的支持。</p><p>416 （请求范围不符合要求） 如果页面无法提供请求的范围，则服务器会返回此状态代码。</p><p>417 （未满足期望值） 服务器未满足&quot;期望&quot;请求标头字段的要求。</p><h2 id="_5开头-服务器错误-这些状态代码表示服务器在尝试处理请求时发生内部错误。-这些错误可能是服务器本身的错误-而不是请求出错" tabindex="-1">5开头（服务器错误）这些状态代码表示服务器在尝试处理请求时发生内部错误。 这些错误可能是服务器本身的错误，而不是请求出错 <a class="header-anchor" href="#_5开头-服务器错误-这些状态代码表示服务器在尝试处理请求时发生内部错误。-这些错误可能是服务器本身的错误-而不是请求出错" aria-label="Permalink to &quot;5开头（服务器错误）这些状态代码表示服务器在尝试处理请求时发生内部错误。 这些错误可能是服务器本身的错误，而不是请求出错&quot;">​</a></h2><p>500 （服务器内部错误） 服务器遇到错误，无法完成请求。</p><p>501 （尚未实施） 服务器不具备完成请求的功能。 例如，服务器无法识别请求方法时可能会返回此代码。</p><p>502 （错误网关） 服务器作为网关或代理，从上游服务器收到无效响应。</p><p>503 （服务不可用） 服务器目前无法使用（由于超载或停机维护） 通常，这只是暂时状态。</p><p>504 （网关超时） 服务器作为网关或代理，但是没有及时从上游服务器收到请求。</p><p>505 （HTTP 版本不受支持） 服务器不支持请求中所用的 HTTP 协议版本</p>',39),h=[o];function _(n,i,s,l,c,d){return a(),t("div",null,h)}const q=p(r,[["render",_]]);export{m as __pageData,q as default};
